import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Video Search with Deep Learning</h1>
    {/*  Just to Test for now*/}
      <label>Concept ID:</label>
      <input type="number"/>
      <label>Concept Name:</label>
      <input type="text"/>
      <button>Add Concept</button>
    </div>
  );
}

export default App;
